import React from 'react';
import Jayalogo from "../assets/logo3.png"

const Header = () => {
  return (
    <header className="sticky top-0 bg-white shadow-md p-4 z-50">
     
      <nav className="flex bg-blue-800 justify-between items-center">
       <img src={Jayalogo} alt="" className="w-28 h-14" />
        <ul className="flex space-x-4 text-">
          <button>প্রবেশ করুন</button>
          <button>নিবন্ধন</button>
          <span>৳ BDT Bengali</span>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
